// ========================================
// DATA MANAGEMENT WITH INDEXEDDB
// ========================================

const DataManager = {
    DB_NAME: 'YohmorLiveDB',
    DB_VERSION: 1,
    STORE_NAME: 'data',
    db: null,
    cachedData: null,

    // Default data structure
    getDefaultData() {
        return {
            businesses: [],
            notifications: [],
            lastUpdated: new Date().toISOString()
        };
    },

    // Initialize IndexedDB
    async init() {
        return new Promise((resolve, reject) => {
            const request = indexedDB.open(this.DB_NAME, this.DB_VERSION);

            request.onerror = () => reject(request.error);

            request.onsuccess = () => {
                this.db = request.result;
                resolve();
            };

            request.onupgradeneeded = (event) => {
                const db = event.target.result;
                if (!db.objectStoreNames.contains(this.STORE_NAME)) {
                    db.createObjectStore(this.STORE_NAME, { keyPath: 'id' });
                }
            };
        });
    },

    // Load data from IndexedDB (with fallback to localStorage for migration)
    async loadAsync() {
        try {
            if (!this.db) await this.init();

            return new Promise((resolve, reject) => {
                const transaction = this.db.transaction([this.STORE_NAME], 'readonly');
                const store = transaction.objectStore(this.STORE_NAME);
                const request = store.get('mainData');

                request.onsuccess = () => {
                    if (request.result) {
                        this.cachedData = request.result.data;
                        resolve(this.cachedData);
                    } else {
                        // Try to migrate from localStorage
                        const oldData = localStorage.getItem('yohmorLiveData');
                        if (oldData) {
                            const parsed = JSON.parse(oldData);
                            this.saveAsync(parsed);
                            localStorage.removeItem('yohmorLiveData');
                            resolve(parsed);
                        } else {
                            resolve(this.getDefaultData());
                        }
                    }
                };
                request.onerror = () => reject(request.error);
            });
        } catch (error) {
            console.error('Error loading data:', error);
            return this.getDefaultData();
        }
    },

    // Synchronous load (uses cache)
    load() {
        if (this.cachedData) return this.cachedData;
        // Fallback for initial load
        const oldData = localStorage.getItem('yohmorLiveData');
        if (oldData) return JSON.parse(oldData);
        return this.getDefaultData();
    },

    // Save data to IndexedDB
    async saveAsync(data) {
        try {
            if (!this.db) await this.init();

            data.lastUpdated = new Date().toISOString();
            this.cachedData = data;

            return new Promise((resolve, reject) => {
                const transaction = this.db.transaction([this.STORE_NAME], 'readwrite');
                const store = transaction.objectStore(this.STORE_NAME);
                const request = store.put({ id: 'mainData', data: data });

                request.onsuccess = () => resolve(true);
                request.onerror = () => reject(request.error);
            });
        } catch (error) {
            console.error('Error saving data:', error);
            return false;
        }
    },

    // Synchronous save (for compatibility - also saves to IndexedDB)
    save(data) {
        data.lastUpdated = new Date().toISOString();
        this.cachedData = data;
        this.saveAsync(data);
        return true;
    },

    // Get all businesses
    getBusinesses() {
        return this.load().businesses || [];
    },

    // Get businesses by category
    getBusinessesByCategory(category) {
        const businesses = this.getBusinesses();
        if (category === 'all') return businesses;
        return businesses.filter(b => b.category === category);
    },

    // Get all notifications
    getNotifications() {
        return this.load().notifications || [];
    },

    // Get active notifications
    getActiveNotifications() {
        const notifications = this.getNotifications();
        const now = new Date();
        return notifications.filter(n => {
            if (!n.active) return false;
            if (n.expiryDate && new Date(n.expiryDate) < now) return false;
            return true;
        });
    }
};


// ========================================
// UI COMPONENTS
// ========================================

const UI = {
    // Render notifications
    renderNotifications() {
        const container = document.getElementById('notifications-container');
        if (!container) return;

        const notifications = DataManager.getActiveNotifications();

        if (notifications.length === 0) {
            container.innerHTML = `
                <div class="no-notifications">
                    <i class="fas fa-bell-slash"></i>
                    <p>لا توجد إشعارات حالياً</p>
                </div>
            `;
            return;
        }

        container.innerHTML = notifications.map((notification, index) => `
            <div class="notification-card ${notification.type}" style="animation-delay: ${index * 0.1}s">
                <div class="notification-icon">
                    <i class="fas ${this.getNotificationIcon(notification.type)}"></i>
                </div>
                <div class="notification-content">
                    <h3>${notification.title}</h3>
                    <p>${notification.message}</p>
                    <div class="notification-meta">
                        <span><i class="fas fa-calendar"></i> ${this.formatDate(notification.date)}</span>
                        ${notification.location ? `<span><i class="fas fa-map-marker-alt"></i> ${notification.location}</span>` : ''}
                    </div>
                </div>
            </div>
        `).join('');
    },

    // Get notification icon based on type
    getNotificationIcon(type) {
        const icons = {
            'info': 'fa-info-circle',
            'warning': 'fa-exclamation-triangle',
            'urgent': 'fa-exclamation-circle',
            'success': 'fa-check-circle'
        };
        return icons[type] || 'fa-bell';
    },

    // Render businesses
    renderBusinesses(category = 'all', filteredBusinesses = null) {
        const container = document.getElementById('businesses-grid');
        if (!container) return;

        const businesses = filteredBusinesses !== null
            ? filteredBusinesses
            : DataManager.getBusinessesByCategory(category);

        if (businesses.length === 0) {
            container.innerHTML = `
                <div class="no-businesses">
                    <i class="fas fa-store-slash"></i>
                    <h3>لا توجد أعمال في هذه الفئة</h3>
                    <p>سيتم إضافة الأعمال قريباً</p>
                </div>
            `;
            return;
        }

        container.innerHTML = businesses.map((business, index) => `
            <div class="business-card" style="animation-delay: ${index * 0.05}s">
                <div class="business-image">
                    <img src="${business.image || 'https://via.placeholder.com/400x250/1a2620/10b981?text=' + encodeURIComponent(business.name)}" 
                         alt="${business.name}"
                         onerror="this.src='https://via.placeholder.com/400x250/1a2620/10b981?text=' + encodeURIComponent('${business.name}')">
                    <span class="business-category-badge">${this.getCategoryName(business.category)}</span>
                </div>
                <div class="business-content">
                    <h3><i class="fas ${this.getCategoryIcon(business.category)}"></i> ${business.name}</h3>
                    <p>${business.description}</p>
                    <div class="business-actions">
                        <a href="https://wa.me/${business.whatsapp}?text=${encodeURIComponent('مرحباً، تواصلت معكم من موقع يحمر لايف')}" 
                           target="_blank" 
                           class="btn btn-whatsapp">
                            <i class="fab fa-whatsapp"></i>
                            واتساب
                        </a>
                        ${business.instagram ? `
                        <a href="${this.getInstagramUrl(business.instagram)}" 
                           target="_blank" 
                           class="btn btn-instagram">
                            <i class="fab fa-instagram"></i>
                            انستغرام
                        </a>
                        ` : ''}
                    </div>
                </div>
            </div>
        `).join('');
    },

    // Get Instagram URL from username or URL
    getInstagramUrl(instagram) {
        if (instagram.startsWith('http')) {
            return instagram;
        }
        // Remove @ if present
        const username = instagram.replace('@', '');
        return `https://instagram.com/${username}`;
    },


    // Get category name in Arabic
    getCategoryName(category) {
        const names = {
            'institutions': 'مؤسسات',
            'associations': 'جمعيات',
            'restaurants': 'مطاعم',
            'services': 'خدمات'
        };
        return names[category] || category;
    },

    // Get category icon
    getCategoryIcon(category) {
        const icons = {
            'institutions': 'fa-building',
            'associations': 'fa-hands-helping',
            'restaurants': 'fa-utensils',
            'services': 'fa-concierge-bell'
        };
        return icons[category] || 'fa-store';
    },

    // Format date
    formatDate(dateString) {
        const date = new Date(dateString);
        const options = { year: 'numeric', month: 'long', day: 'numeric' };
        return date.toLocaleDateString('ar-LB', options);
    },

    // Show toast notification
    showToast(message, type = 'info') {
        let container = document.querySelector('.toast-container');
        if (!container) {
            container = document.createElement('div');
            container.className = 'toast-container';
            document.body.appendChild(container);
        }

        const toast = document.createElement('div');
        toast.className = `toast ${type}`;
        toast.innerHTML = `<i class="fas ${type === 'success' ? 'fa-check-circle' : 'fa-info-circle'}"></i> ${message}`;
        container.appendChild(toast);

        setTimeout(() => {
            toast.style.animation = 'slideOutUp 0.3s ease-out forwards';
            setTimeout(() => toast.remove(), 300);
        }, 3000);
    },

    // Update stats
    updateStats() {
        const businesses = DataManager.getBusinesses();
        const stats = {
            total: businesses.length,
            institutions: businesses.filter(b => b.category === 'institutions').length,
            restaurants: businesses.filter(b => b.category === 'restaurants').length,
            services: businesses.filter(b => b.category === 'services').length
        };

        document.querySelectorAll('[data-stat]').forEach(el => {
            const stat = el.dataset.stat;
            if (stats[stat] !== undefined) {
                this.animateNumber(el, stats[stat]);
            }
        });
    },

    // Animate number
    animateNumber(element, target) {
        const duration = 1500;
        const start = 0;
        const startTime = performance.now();

        const animate = (currentTime) => {
            const elapsed = currentTime - startTime;
            const progress = Math.min(elapsed / duration, 1);
            const easeOut = 1 - Math.pow(1 - progress, 3);
            const current = Math.floor(start + (target - start) * easeOut);

            element.textContent = current + '+';

            if (progress < 1) {
                requestAnimationFrame(animate);
            }
        };

        requestAnimationFrame(animate);
    }
};

// ========================================
// EVENT HANDLERS
// ========================================

const EventHandlers = {
    // Initialize category tabs
    initCategoryTabs() {
        const tabs = document.querySelectorAll('.category-tab');
        tabs.forEach(tab => {
            tab.addEventListener('click', () => {
                tabs.forEach(t => t.classList.remove('active'));
                tab.classList.add('active');
                const category = tab.dataset.category;
                UI.renderBusinesses(category);
            });
        });
    },

    // Initialize header scroll effect
    initHeaderScroll() {
        const header = document.querySelector('header');
        if (!header) return;

        let lastScroll = 0;
        window.addEventListener('scroll', () => {
            const currentScroll = window.pageYOffset;

            if (currentScroll > 50) {
                header.classList.add('scrolled');
            } else {
                header.classList.remove('scrolled');
            }

            lastScroll = currentScroll;
        });
    },

    // Initialize mobile menu
    initMobileMenu() {
        const menuBtn = document.querySelector('.mobile-menu-btn');
        const nav = document.querySelector('nav');

        if (menuBtn && nav) {
            menuBtn.addEventListener('click', () => {
                nav.classList.toggle('active');
                menuBtn.innerHTML = nav.classList.contains('active')
                    ? '<i class="fas fa-times"></i>'
                    : '<i class="fas fa-bars"></i>';
            });

            // Close menu on link click
            nav.querySelectorAll('a').forEach(link => {
                link.addEventListener('click', () => {
                    nav.classList.remove('active');
                    menuBtn.innerHTML = '<i class="fas fa-bars"></i>';
                });
            });
        }
    },

    // Initialize smooth scroll
    initSmoothScroll() {
        document.querySelectorAll('a[href^="#"]').forEach(anchor => {
            anchor.addEventListener('click', function (e) {
                e.preventDefault();
                const target = document.querySelector(this.getAttribute('href'));
                if (target) {
                    const headerOffset = 80;
                    const elementPosition = target.getBoundingClientRect().top;
                    const offsetPosition = elementPosition + window.pageYOffset - headerOffset;

                    window.scrollTo({
                        top: offsetPosition,
                        behavior: 'smooth'
                    });
                }
            });
        });
    },

    // Initialize scroll animations
    initScrollAnimations() {
        const observerOptions = {
            threshold: 0.1,
            rootMargin: '0px 0px -50px 0px'
        };

        const observer = new IntersectionObserver((entries) => {
            entries.forEach(entry => {
                if (entry.isIntersecting) {
                    entry.target.classList.add('animate-in');
                    observer.unobserve(entry.target);
                }
            });
        }, observerOptions);

        document.querySelectorAll('.business-card, .notification-card, .feature-item').forEach(el => {
            observer.observe(el);
        });
    },

    // Initialize search functionality
    initSearch() {
        const searchInput = document.getElementById('search-input');
        const clearBtn = document.getElementById('clear-search');
        const resultsCount = document.getElementById('search-results-count');

        if (!searchInput) return;

        let currentCategory = 'all';
        let searchQuery = '';

        // Get current active category
        const getActiveCategory = () => {
            const activeTab = document.querySelector('.category-tab.active');
            return activeTab ? activeTab.dataset.category : 'all';
        };

        // Filter and render businesses
        const filterBusinesses = (query, category) => {
            const businesses = DataManager.getBusinesses();

            // Filter by category first
            let filtered = category === 'all'
                ? businesses
                : businesses.filter(b => b.category === category);

            // Then filter by search query if provided
            if (query && query.length > 0) {
                const searchLower = query.toLowerCase().trim();
                filtered = filtered.filter(b =>
                    b.name.toLowerCase().includes(searchLower) ||
                    b.description.toLowerCase().includes(searchLower)
                );
            }

            // Update results count display
            if (query && query.length > 0) {
                resultsCount.textContent = `تم العثور على ${filtered.length} نتيجة`;
                resultsCount.style.display = 'block';
            } else {
                resultsCount.style.display = 'none';
            }

            // Render filtered businesses
            UI.renderBusinesses(category, filtered);
        };

        // Search input handler with debouncing
        let searchTimeout;
        searchInput.addEventListener('input', (e) => {
            clearTimeout(searchTimeout);
            searchTimeout = setTimeout(() => {
                searchQuery = e.target.value.trim();
                currentCategory = getActiveCategory();

                // Show/hide clear button
                if (searchQuery && searchQuery.length > 0) {
                    clearBtn.style.display = 'block';
                } else {
                    clearBtn.style.display = 'none';
                }

                filterBusinesses(searchQuery, currentCategory);
            }, 300); // Debounce for 300ms
        });

        // Clear button handler
        if (clearBtn) {
            clearBtn.addEventListener('click', () => {
                searchInput.value = '';
                searchQuery = '';
                clearBtn.style.display = 'none';
                resultsCount.style.display = 'none';
                currentCategory = getActiveCategory();
                filterBusinesses('', currentCategory);
                searchInput.focus();
            });
        }

        // Update category tabs to work with search
        const tabs = document.querySelectorAll('.category-tab');
        tabs.forEach(tab => {
            tab.addEventListener('click', () => {
                currentCategory = tab.dataset.category;
                searchQuery = searchInput.value.trim();
                filterBusinesses(searchQuery, currentCategory);
            });
        });
    }
};

