// Initialize data from data.json or sample data
async function initializeSampleData() {
    // Always try to fetch from data.json first (for GitHub Pages)
    try {
        // Add cache-busting timestamp to force fresh data from GitHub Pages
        const cacheBuster = new Date().getTime();
        const response = await fetch(`data.json?v=${cacheBuster}`, {
            cache: 'no-store',
            headers: {
                'Cache-Control': 'no-cache'
            }
        });
        if (response.ok) {
            const jsonData = await response.json();
            await DataManager.saveAsync({
                businesses: jsonData.businesses || [],
                notifications: jsonData.notifications || [],
                lastUpdated: new Date().toISOString()
            });
            console.log('✅ Data loaded from data.json (fresh)');
            return;
        }
    } catch (error) {
        console.log('ℹ️ Could not load data.json, checking existing data:', error);
    }

    // If data.json is not available, check existing data
    const existingData = await DataManager.loadAsync();
    DataManager.cachedData = existingData;

    // If no data exists, use sample data as fallback
    if (existingData.businesses.length === 0 && existingData.notifications.length === 0) {
        await DataManager.saveAsync({
            businesses: SampleData.businesses,
            notifications: SampleData.notifications,
            lastUpdated: new Date().toISOString()
        });
        console.log('✅ Sample data initialized');
    }
}

// ========================================
// INITIALIZATION
// ========================================

document.addEventListener('DOMContentLoaded', async () => {
    // Initialize IndexedDB and load data
    await DataManager.init();
    await initializeSampleData();

    // Force reload data to ensure it's fresh
    const currentData = await DataManager.loadAsync();
    DataManager.cachedData = currentData;

    // Render content
    UI.renderNotifications();
    UI.renderBusinesses('all');
    UI.updateStats();

    // Initialize event handlers
    EventHandlers.initCategoryTabs();
    EventHandlers.initSearch();
    EventHandlers.initHeaderScroll();
    EventHandlers.initMobileMenu();
    EventHandlers.initSmoothScroll();
    EventHandlers.initScrollAnimations();

    console.log('🌿 Yohmor Live initialized with IndexedDB - Unlimited storage!');
});

// Export for admin panel use
window.YohmorLive = {
    DataManager,
    UI,
    SampleData
};
